import React, { Component } from "react";
import { Route, Switch, Router, NavLink } from "react-router-dom";
import history from './'
export const routes = () => {
  return (
    <Router history={history}>
      <Route
        path="/"
        exact
        strict
        render={(props) => <LoggedInMessage {...props} />}
      />
    </Router>
  );
};
